    false,nt"url": null,nt"notes": "This annual narrative report for Swan Lake
    NWR outlines Refuge accomplishments during the 1991 calendar year. The report begins
    with a summary of the year's highlights and weather conditions. Land acquisition
    is covered. The report includes a planning section which discusses research and
    investigations. Refuge administration is outlined; information about personnel,
    youth programs, volunteer programs, funding, and safety is given. Habitat management
    is also covered; subjects include wetlands, croplands, grasslands, haying, fire
    management, and pest control. The wildlife section of the report discusses wildlife
    diversity, endangered and threatened species, waterfowl, marsh birds and waterbirds,
    shorebirds, raptors, game mammals, marking and bird banding, and disease control.
    The public uses of the Refuge described in this report include interpretive programs,
    hunting, fishing, wildlife observation, and law enforcement. The equipment and facilities
    section of the report provides information about rehabilitation, equipment replacement,
    communication systems, and computer systems. Items of interest are provided at the
    end.",nt"owner_org": "4d7ad1cd-3641-420b-8116-e4082f49cd44",nt"extras":
